import React from 'react';
import { Navbar } from 'react-bootstrap';

export default class MyNavbar extends React.Component {
  render() {
    return (
      <Navbar bg="primary" variant="dark">
        <Navbar.Brand style={{ justifyContent: 'center', alignItems: 'center' }}>
          Navbar
        </Navbar.Brand>
      </Navbar>
    );
  }
}
